import React, { useState, useEffect } from "react";
import { successModal, unsuccessModal } from "./Utility";

const Trade = () => {
  const [trades, setTrades] = useState([]);
  const [error, setError] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  const fetchTrades = async () => {
    try {
      const response = await fetch("http://localhost:8000/trades");
      if (!response.ok) {
        throw new Error("Failed to fetch trades data");
      }
      const data = await response.json();
      successModal();
      setTrades(data.trades);
    } catch (error) {
      setError(error.message);
      unsuccessModal(error.message);
    }
  };
  useEffect(() => {
    fetchTrades();
  }, []);

  // Render the component JS
  return (
    <div className="trade">
      <div className="header">
        <p className="">Trades</p>
        <i className="fa-solid fa-plus" id="new-btn" onClick={openModal}></i>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Options</th>
            <th>Trade Date</th>
            <th>Settle Date</th>
            <th>Price</th>
            <th>Principle</th>
            <th>QTY</th>
            <th>Exit</th>
            <th>Net Amount</th>
            <th>P/L</th>
            <th>%</th>
          </tr>
        </thead>
        <tbody>
          {trades.map((trade) => (
            <tr key={trade[0]}>
              {" "}
              <td>{trade[0]}</td> {/* Trade ID */}
              <td>
                {trade[1]} {trade[2]} ${trade[3]}{" "}
                {trade[4].split("-").slice(1).join("/")}
              </td>
              {/* Symbol, Option Type, Strike Price */}
              <td>{trade[8].split("-").slice(1).join("/")}</td>
              {/* Trade Date */}
              <td>{trade[9].split("-").slice(1).join("/")}</td>
              {/* Settle Date */}
              <td>${trade[5]}</td> {/* Price */}
              <td>${(trade[5] * trade[7] * 100).toFixed(2)}</td>
              {/* Principle */}
              <td>{trade[7]}</td> {/* QTY */}
              <td>${trade[6]}</td> {/* Exit */}
              <td>
                {trade[6] && trade[7]
                  ? `$${(trade[6] * trade[7] * 100).toFixed(2)}`
                  : ""}
              </td>{" "}
              {/* Net Amount */}
              <td>
                {trade[10] && trade[7]
                  ? `$${(trade[10] * trade[7] * 100).toFixed(2)}`
                  : ""}
              </td>{" "}
              {/* P/L */}
              <td>
                {trade[10]
                  ? `${(((trade[6] - trade[5]) / trade[5]) * 100).toFixed(2)}%`
                  : ""}
              </td>{" "}
            </tr>
          ))}
        </tbody>
      </table>
      {/* Modal for adding new trade */}
      <Modal isOpen={isModalOpen} onClose={closeModal}>
        <TradeForm />
      </Modal>
    </div>
  );
};

export default Trade;
